import React from "react";
import { DisplayCards } from "./DisplayCards";

export default function ListDeckItems(props) {
  const { decks } = props;

  return (
    <ul classname="container">
      {decks.map((deck) => {
        return <li className="list-group-item">deck.name</li>;
      })}
    </ul>
  );
}
